l</th><th scope=col>f1</th></tr>\n","\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><th scope=row>FALSE</th><td>0.8795662</td><td>0.9673572</td><td>0.9213752</td></tr>\n","\t<tr><th scope=row>TRUE</th><td>0.7903226</td><td>0.4815725</td><td>0.5984733</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A data.frame: 2 × 3\n","\\begin{tabular}{r|lll}\n","  & precision & recall & f1\\\\\n","  & <dbl> & <dbl> & <dbl>\\\\\n","\\hline\n","\tFALSE & 0.8795662 & 0.9673572 & 0.9213752\\\\\n","\tTRUE & 0.7903226 & 0.4815725 & 0.5984733\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A data.frame: 2 × 3\n","\n","| <!--/--> | precision &lt;dbl&gt; | recall &lt;dbl&gt; | f1 &lt;dbl&gt; |\n","|---|---|---|---|\n","| FALSE | 0.8795662 | 0.9673572 | 0.9213752 |\n","| TRUE | 0.7903226 | 0.4815725 | 0.5984733 |\n","\n"],"text/plain":["      precision recall    f1       \n","FALSE 0.8795662 0.9673572 0.9213752\n","TRUE  0.7903226 0.4815725 0.5984733"]},"metadata":{},"output_type":"display_data"}],"source":["# Fitting XGBoost to the Training set\n","# install.packages('xgboost')\n","library(xgboost)\n","classifier = xgboost(data = as.matrix(train_set[-11]), label = train_set$Exited, nrounds = 10, verbose = 0)\n","\n","# Predicting the Test set results\n","y_pred = predict(classifier, newdata = as.matrix(test_set[-11]))\n","y_pred = (y_pred >= 0.5)\n","\n","# Making the Confusion Matrix\n","cm = table(test_set[, 11], y_pred)\n","\n","#Evaluation Metrics\n","n = sum(cm) # number of instances\n","nc = nrow(cm) # number of classes\n","diag = diag(cm) # number of correctly classified instances per class \n","rowsums = apply(cm, 1, sum) # number of instances per class\n","colsums = apply(cm, 2, sum) # number of predictions per class\n","p = rowsums / n # distribution of instances over the actual classes\n","q = colsums / n # distribution of instances over the predicted classes\n","accuracy = sum(diag) / n \n","cat(\"\\n Accuracy of XG Boost  Model is:\", accuracy)  \n","precision = diag / colsums \n","recall = diag / rowsums \n","f1 = 2 * precision * recall / (precision + recall)\n","cat(\"\\n \\nThe Evaluation Metrics of XG Boost  Model is: \\n \\n\")\n","data.frame(precision, recall, f1)"]},{"cell_type":"code","execution_count":4,"id":"e2921d1a","metadata":{"execution":{"iopub.execute_input":"2022-03-27T12:54:22.847846Z","iopub.status.busy":"2022-03-27T12:54:22.846193Z","iopub.status.idle":"2022-03-27T12:54:22.879449Z","shell.execute_reply":"2022-03-27T12:54:22.877296Z"},"papermill":{"duration":0.120956,"end_time":"2022-03-27T12:54:22.879641","exception":false,"start_time":"2022-03-27T12:54:22.758685","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\n"," Accuracy computed using MLmetrics of XG Boost  Model is: 0.8685"]}],"source":["#install.packages('MLmetrics')\n","#library(MLmetrics)\n","#accuracy = Accuracy(y_pred, test_set[11])\n","accuracy = MLmetrics::Accuracy(y_pred, test_set[11])\n","cat(\"\\n Accuracy computed using MLmetrics of XG Boost  Model is:\", accuracy)"]},{"cell_type":"markdown","id":"febfa0b5","metadata":{"papermill":{"duration":0.083896,"end_time":"2022-03-27T12:54:23.045087","exception":false,"start_time":"2022-03-27T12:54:22.961191","status":"completed"},"tags":[]},"source":["### **Applying k-Fold Cross Validation**"]},{"cell_type":"code","execution_count":5,"id":"3a375bae","metadata":{"execution":{"iopub.execute_input":"2022-03-27T12:54:23.218448Z","iopub.status.busy":"2022-03-27T12:54:23.216791Z","iopub.status.idle":"2022-03-27T12:54:25.344315Z","shell.execute_reply":"2022-03-27T12:54:25.342654Z"},"papermill":{"duration":2.212964,"end_time":"2022-03-27T12:54:25.344498","exception":false,"start_time":"2022-03-27T12:54:23.131534","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Loading required package: lattice\n","\n","Loading required package: ggplot2\n","\n","\n","Attaching package: ‘caret’\n","\n","\n","The following object is masked from ‘package:httr’:\n","\n","    progress\n","\n","\n"]},{"name":"stdout","output_type":"stream","text":["\n"," Mean Accuracy of XGBoost Model is: 0.858375"]}],"source":["# install.packages('caret')\n","library(caret)\n","folds = createFolds(train_set$Exited, k = 10)\n","cv = lapply(folds, function(x) {\n","  training_fold = train_set[-x, ]\n","  test_fold = train_set[x, ]\n","  classifier = xgboost(data = as.matrix(training_fold[-11]), label = training_fold$Exited, nrounds = 10, verbose = 0)\n","  y_pred = predict(classifier, newdata = as.matrix(test_fold[-11]))\n","  #y_pred = (y_pred >= 0.5)\n","  y_pred = ifelse(y_pred > 0.5, 1, 0)  \n","  cm = table(test_fold[, 11], y_pred)          \n","  accuracy = (cm[1,1] + cm[2,2]) / (cm[1,1] + cm[2,2] + cm[1,2] + cm[2,1])\n","  return(accuracy)\n","})\n","accuracy = mean(as.numeric(cv))\n","cat(\"\\n Mean Accuracy of XGBoost Model is:\", accuracy)  "]},{"cell_type":"markdown","id":"d884a1e9","metadata":{"papermill":{"duration":0.086151,"end_time":"2022-03-27T12:54:25.517481","exception":false,"start_time":"2022-03-27T12:54:25.43133","status":"completed"},"tags":[]},"source":["## **XGBoost Regression**\n","### **Data Preprocessing**\n","**Data Set Information:**\n","\n","The dataset contains 9568 data points collected from a Combined Cycle Power Plant over 6 years (2006-2011), when the power plant was set to work with full load. Features consist of hourly average ambient variables Temperature (T), Ambient Pressure (AP), Relative Humidity (RH) and Exhaust Vacuum (V) to predict the net hourly electrical energy output (EP) of the plant.\n","\n","**Attribute Information:**\n","\n","Features consist of hourly average ambient variables\n","* Temperature (AT) in the range 1.81°C and 37.11°C,\n","* Ambient Pressure (AP) in the range 992.89-1033.30 milibar,\n","* Relative Humidity (RH) in the range 25.56% to 100.16%\n","* Exhaust Vacuum (V) in teh range 25.36-81.56 cm Hg\n","* Net hourly electrical energy output (PE) 420.26-495.76 MW\n","\n","### **Importing the dataset**"]},{"cell_type":"code","execution_count":6,"id":"c9ad1677","metadata":{"execution":{"iopub.execute_input":"2022-03-27T12:54:25.705793Z","iopub.status.busy":"2022-03-27T12:54:25.703159Z","iopub.status.idle":"2022-03-27T12:54:25.77841Z","shell.execute_reply":"2022-03-27T12:54:25.777046Z"},"papermill":{"duration":0.169305,"end_time":"2022-03-27T12:54:25.778587","exception":false,"start_time":"2022-03-27T12:54:25.609282","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["First three rows of dataset \n"]},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 3 × 5</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>AT</th><th scope=col>V</th><th scope=col>AP</th><th scope=col>RH</th><th scope=col>PE</th></tr>\n","\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><th scope=row>1</th><td>14.96</td><td>41.76</td><td>1024.07</td><td>73.17</td><td>463.26</td></tr>\n","\t<tr><th scope=row>2</th><td>25.18</td><td>62.96</td><td>1020.04</td><td>59.08</td><td>444.37</td></tr>\n","\t<tr><th scope=row>3</th><td> 5.11</td><td>39.40</td><td>1012.16</td><td>92.14</td><td>488.56</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A data.frame: 3 × 5\n","\\begin{tabular}{r|lllll}\n","  & AT & V & AP & RH & PE\\\\\n","  & <dbl> & <dbl> & <dbl> & <dbl> & <dbl>\\\\\n","\\hline\n","\t1 & 14.96 & 41.76 & 1024.07 & 73.17 & 463.26\\\\\n","\t2 & 25.18 & 62.96 & 1020.04 & 59.08 & 444.37\\\\\n","\t3 &  5.11 & 39.40 & 1012.16 & 92.14 & 488.56\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A data.frame: 3 × 5\n","\n","| <!--/--> | AT &lt;dbl&gt; | V &lt;dbl&gt; | AP &lt;dbl&gt; | RH &lt;dbl&gt; | PE &lt;dbl&gt; |\n","|---|---|---|-